func TestMerge(t *testing.T) {
	buf := bufPool.Get().(*bytes.Buffer)
	defer bufPool.Put(buf)
	repComma := strings.NewReplacer(`",`, `",`+"\n")
	for tN, tC := range map[string]struct {
		Want  string
		Input []interface{}
	}{
		"noSlice": {
			Input: toIntf([]struct {
				B string
				A int
			}{{A: 1, B: "x"}}),
			Want: `{"A":1,"B":"x"}`,
		},
		"onlyOneSlice": {
			Input: toIntf([]struct {
				A []string
			}{{A: []string{"1"}}, {A: []string{"2"}}, {A: []string{"3"}}}),
			Want: `{"A":["1","2","3"]}` + "\n",
		},
		"twoSlice": {
			Input: toIntf([]struct {
				A []string
				B []int
			}{{A: []string{"1"}, B: []int{33}}, {A: []string{"2"}, B: []int{44}}, {A: []string{"3"}}}),
			Want: `{"A":["1","2","3"],"B":[33,44]}` + "\n",
		},
		"mixed": {
			Input: toIntf([]struct {
				A []string
				B int
			}{{A: []string{"1"}, B: 33}, {A: []string{"2"}}, {A: []string{"3"}}}),
			Want: `{"B":33,"A":["1","2","3"]}` + "\n",
		},

		"big1": {
			Input: jsToIntf(strings.NewReader(jsBig1In)),
			Want:  jsBig1Out,
		},
	} {
		buf.Reset()
		recv := &receiver{parts: tC.Input}
		first, _ := recv.Recv()
		mergeStreams(buf, first, recv, testr.New(t))
		_ = repComma
		d, err := jsondiff.DiffStrings(
			//repComma.Replace(tC.Want),
			//repComma.Replace(buf.String()),
			tC.Want,
			buf.String(),
		)
		if err != nil {
			t.Fatalf("%s: %+v", tN, err)
		}
		if d != "" {
			t.Error(tN+":", d)
		}
	}
}

func jsToIntf(r io.Reader) []interface{} {
	dec := json.NewDecoder(r)
	res := make([]interface{}, 0, 8)
	type retType struct {
		Ret []map[string]interface{} `json:"ret"`
	}
	for {
		var rt retType
		if err := dec.Decode(&rt); err != nil {
			if err == io.EOF {
				break
			}
			panic(err)
		}
		res = append(res, rt)
	}
	return res
}

func toIntf(someSlice interface{}) []interface{} {
	rv := reflect.ValueOf(someSlice)
	res := make([]interface{}, rv.Len())
	for i := range res {
		res[i] = rv.Index(i).Interface()
	}
	return res
}

type receiver struct {
	parts []interface{}
}

func (r *receiver) Recv() (interface{}, error) {
	if len(r.parts) == 0 {
		return nil, io.EOF
	}
	p := r.parts[0]
	r.parts = r.parts[1:]
	return p, nil
}

func TestTrimWriter(t *testing.T) {
	buf := bufPool.Get().(*bytes.Buffer)
	bufPool.Put(buf)
	for tN, tC := range map[string]struct {
		Input, Prefix, Suffix, Want string
	}{
		"\\n":   {Input: "\"A\"\n", Prefix: "", Suffix: "\n", Want: "\"A\""},
		"[]":    {Input: "[1]", Prefix: "[", Suffix: "]", Want: "1"},
		"[]\\n": {Input: "[\"1\"]\n", Prefix: "[", Suffix: "]\n", Want: "\"1\""},
	} {
		buf.Reset()
		tw := stream.NewTrimFix(buf, tC.Prefix, tC.Suffix)
		if _, err := io.WriteString(tw, tC.Input); err != nil {
			t.Error(tN+":", err)
		}
		if err := tw.Close(); err != nil {
			t.Error(tN+":", err)
		}
		if d := diff.Diff(buf.String(), tC.Want); d != "" {
			t.Error(tN+":", d)
		}
	}
}

